  b 15.12.1967
  b 21.01.1970
  Caroline m, at St Mary's Church, Tikitiki. Address: Gold Creek Station, RD 2, Te Karaka, Gisborne.
  Caroline was educated at Corran School and Auckland Diocesan School. She completed a Cordon Bleu
  Cooking Course and was a chef at Moose Lodge, Rotorua in 1985-86. After three years overseas in
  USA and UK, working in the hotel industry, she is now working for Cotterill & Rouse.
  Andrew was educated at Gisborne Boys' High School then gained a Diploma of Agriculture at Lincoln
  University in 1988. Since then he has worked on a number of stations throughout New Zealand and is
  currently managing "Gold Creek" station, Otoko. He is a keen horseman, dog triallist and
  fisherman.
